When the Glade of Dreams is overrun by nefurrious Darktoons, the Fairy Council hastily invokes
Rayman to save the day. To help him, Rayman teams up with his best friend, Globox, and two
crafty wizards, the Teensies. Together, the world's most hilarious team of heroes will need
to restore peace to the Glade or watch as their beloved home vanishes like a bad dream...

